import React, { useEffect, useState } from "react";
import SectionCard from "../SectionCard";
import {
  fetchPendingMicroempresas,
  approvePendingMicroempresa,
  rejectPendingMicroempresa,
} from "../../controllers/subscriptionController";

const fallbackPendingFromDashboard = (dashboardData) => {
  const items = dashboardData?.microempresas || [];
  // consideramos "pendiente" o cualquier estado != activo
  return items.filter((m) => m.estado && m.estado !== "activo");
};

export default function SuperUsuarioPendientes({ dashboardData, reloadDashboard }) {
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(false);
  const [message, setMessage] = useState("");

  const load = async () => {
    setLoading(true);
    setMessage("");

    try {
      const { response, data } = await fetchPendingMicroempresas();

      if (!response.ok) {
        // fallback con dashboard (para que no se rompa si aún no implementas endpoint)
        const fallback = fallbackPendingFromDashboard(dashboardData);
        setItems(fallback);
        setMessage(
          data.error ||
            "No se pudo cargar desde endpoint de pendientes. Mostrando datos del dashboard (fallback)."
        );
        return;
      }

      setItems(data.items || data.microempresas || []);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    load();
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const approve = async (tenantId) => {
    setMessage("");
    const { response, data } = await approvePendingMicroempresa(tenantId);
    if (!response.ok) {
      setMessage(data.error || "No se pudo aprobar.");
      return;
    }
    setMessage(data.message || "Aprobado.");
    await load();
    if (reloadDashboard) await reloadDashboard();
  };

  const reject = async (tenantId) => {
    setMessage("");
    const { response, data } = await rejectPendingMicroempresa(tenantId);
    if (!response.ok) {
      setMessage(data.error || "No se pudo rechazar.");
      return;
    }
    setMessage(data.message || "Rechazado.");
    await load();
    if (reloadDashboard) await reloadDashboard();
  };

  return (
    <SectionCard
      title="Microempresas en espera"
      description="Revisa comprobantes y valida cuentas."
    >
      <div className="card">
        <div style={{ display: "flex", gap: 10, marginBottom: 10 }}>
          <button type="button" className="ghost-button" onClick={load} disabled={loading}>
            {loading ? "Cargando..." : "Recargar"}
          </button>
        </div>

        {message && <p className={message.toLowerCase().includes("no") ? "error" : "muted"}>{message}</p>}

        {items.length === 0 ? (
          <p className="muted">No hay microempresas en espera.</p>
        ) : (
          <div className="data-list">
            {items.map((m) => (
              <div className="data-row" key={m.tenant_id}>
                <div>
                  <div style={{ fontWeight: 600 }}>{m.nombre}</div>
                  <div className="muted">{m.email}</div>
                  <div className="muted">Estado: {m.estado || "pendiente"}</div>

                  {/* si tu backend devuelve comprobante_url */}
                  {m.comprobante_url && (
                    <div style={{ marginTop: 6 }}>
                      <a href={m.comprobante_url} target="_blank" rel="noreferrer">
                        Ver comprobante
                      </a>
                    </div>
                  )}
                </div>

                <div className="row-actions" style={{ gap: 8 }}>
                  <button type="button" className="ghost-button" onClick={() => approve(m.tenant_id)}>
                    Aprobar
                  </button>
                  <button type="button" className="danger-button" onClick={() => reject(m.tenant_id)}>
                    Rechazar
                  </button>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </SectionCard>
  );
}
